Desenvolvimento
Introdução
Para o desenvolvimento da aplicação, optamos pela plataforma Java, dada a sua ubiquidade e facilidade de manutenção, ferramental existente e bibliotecas maduras. Além disso, Java é amplamente utilizada em aplicações existentes na atual infraestrutura do Governo Brasileiro, o que faz com que seu suporte e desenvolvimento continuado sejam garantidos.
Pretendemos utilizar e acompanhar as ferramentas e bibliotecas mais adequadas às necessidades do desenvolvimento, testando com as versões mais recentes das mesmas sempre que possível.
Objetivos técnicos

Código limpo e de fácil compreensão;
Documentação técnica gerada automaticamente através do código;
Configuração programática;
Gerenciamento de dependências centralizado;
Testes automatizados de alta qualidade;
Pacotes gerados automaticamente para as plataformas-alvo;
Implantação e execução no menor número de passos possível;

desenvolvimento/monitoramento.html.body:
Monitoramento
A monitoração da saúde do host é feita de maneira externa, utilizando Nagios. Para o monitoramento das instâncias da aplicação e ElasticSearch, com informações mais detalhadas, as seguintes opções estão disponíveis:
Portal de Serviços
O Portal de Serviços disponibiliza informações de saúde através do endereço /health, que retorna JSON similar ao seguinte:
{
  "status": "UP",
  "portalDeServicosIndex": {
    "status": "UP",
    "portal-de-servicos": "ok (622 docs)"
  },
  "elasticSearch": {
    "status": "GREEN",
    "nodes": 3,
    "node-0": "es1",
    "node-1": "logstash-d9ccaa4d20c4-1-11624",
    "node-2": "es2"
  },
  "cache": {
    "status": "UNKNOWN"
  },
  "diskSpace": {
    "status": "UP",
    "free": 17378258944,
    "threshold": 10485760
  }
}

Nele, é possível ver o estado geral da aplicação (status), do índice no ElasticSearch (portalDeServicosIndex), informações de conexão ao ElasticSearch (elasticsearch), do estado do cache interno de páginas (cache) e espaço em disco (diskSpace).
Editor de Serviços
O Editor de Serviços disponibiliza informações de saúde através do endereço /editar/health, que retorna JSON similar ao seguinte:
{
  "status": "UP",
  "diskSpace": {
    "status": "UP",
    "free": 17378254848,
    "threshold": 10485760
  }
}

Nele, é possível ver o estado geral da aplicação (status) e do espaço em disco (diskSpace).

